const iniState = {
    userInfo:{},
    token:null,
    errors:null,
    isAth:false
}
const userReducer = (state = iniState, {type, payload}) =>{
    switch (type) {
        case REGISTER_FAIL :
            return {...state, errors:payload}
            case REGISTER_SUCCESS:
                 return { ...state, errors: payload };
        default:
            return state
    }
}
export default userReducer
